import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';

export default function AdminPage() {
  const API = process.env.REACT_APP_API_URL;
  const navigate = useNavigate();
  const { surveyId } = useParams();
  const [selectedSurvey, setSelectedSurvey] = useState(surveyId || '');
  const [questions, setQuestions] = useState([]);
  const [editing, setEditing] = useState({});
  const [newQ, setNewQ] = useState({ category: '', description: '', weight: 1 });
  const [error, setError] = useState('');

  const loadQuestions = (survey) => {
    axios.get(`${API}/usf/questions?survey=${survey}`)
      .then(r => setQuestions(r.data.questions))
      .catch(() => setError('Error loading questions'));
  };

  useEffect(() => {
    axios.get(`${API}/usf/me`, { withCredentials: true })
      .then(r => {
        if (!r.data.logged_in) navigate('/login');
        else if (surveyId) loadQuestions(surveyId);
      })
      .catch(() => navigate('/login'));
  }, [surveyId]);

  const handleUpdate = (q) => {
    axios.put(`${API}/usf/questions/${q.id}`, q, { withCredentials: true })
      .then(() => loadQuestions(selectedSurvey));
  };

  const handleDelete = (id) => {
    axios.delete(`${API}/usf/questions/${id}`, { withCredentials: true })
      .then(() => loadQuestions(selectedSurvey));
  };

  const handleCreate = () => {
    axios.post(`${API}/usf/questions`, { ...newQ, survey: selectedSurvey }, { withCredentials: true })
      .then(() => {
        setNewQ({ category: '', description: '', weight: 1 });
        loadQuestions(selectedSurvey);
      })
      .catch(() => setError('Error creating question'));
  };

  return (
    <div className="container my-4">
      <h2>Survey Admin</h2>
      {error && <p className="text-danger">{error}</p>}

      <div className="mb-4">
        <label className="form-label">Select Survey:</label>
        <select
          className="form-select"
          value={selectedSurvey}
          onChange={e => {
            setSelectedSurvey(e.target.value);
            navigate(`/admin/${e.target.value}`);
          }}
        >
          <option value="">-- Choose a Survey --</option>
          <option value="survey1">Survey 1</option>
          <option value="survey2">Survey 2</option>
        </select>
      </div>

      <h4>Add New Question</h4>
      <div className="d-flex mb-3 gap-2">
        <input type="text" placeholder="Category" className="form-control"
          value={newQ.category} onChange={e => setNewQ({ ...newQ, category: e.target.value })} />
        <input type="text" placeholder="Description" className="form-control"
          value={newQ.description} onChange={e => setNewQ({ ...newQ, description: e.target.value })} />
        <input type="number" className="form-control" style={{ width: '80px' }}
          min="1" value={newQ.weight} onChange={e => setNewQ({ ...newQ, weight: e.target.value })} />
        <button className="btn-crimson" onClick={handleCreate}>Add</button>
      </div>

      <table className="table table-bordered">
        <thead className="table-light">
          <tr>
            <th>ID</th><th>Category</th><th>Description</th><th>Weight</th><th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {questions.map(q => (
            <tr key={q.id}>
              <td>{q.id}</td>
              <td>
                <input
                  className="form-control"
                  value={editing[q.id]?.category ?? q.category}
                  onChange={e => setEditing({
                    ...editing,
                    [q.id]: { ...q, category: e.target.value }
                  })}
                />
              </td>
              <td>
                <input
                  className="form-control"
                  value={editing[q.id]?.description ?? q.description}
                  onChange={e => setEditing({
                    ...editing,
                    [q.id]: { ...q, description: e.target.value }
                  })}
                />
              </td>
              <td>
                <input type="number" min="1"
                  className="form-control"
                  value={editing[q.id]?.weight ?? q.weight}
                  onChange={e => setEditing({
                    ...editing,
                    [q.id]: { ...q, weight: e.target.value }
                  })}
                />
              </td>
              <td className="d-flex gap-2">
                <button
                  className="btn btn-sm btn-primary"
                  onClick={() => handleUpdate(editing[q.id] || q)}
                >
                  Save
                </button>
                <button
                  className="btn btn-sm btn-danger"
                  onClick={() => handleDelete(q.id)}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
